// colors 

$primaryClr: #373D4B;
$secondClr: #D33D27;
$thirdClr: #343434;
$padding: 0 4rem;
$spacing-between: 5rem 0; 
$spacing-between-inner: 2rem 0;

// mixins 

@mixin flexbox($justify, $align) 
{
    display: flex;
    justify-content: $justify;
    align-items: $align;
}

@mixin resetLinks($clr) {
    text-decoration: none;
    color: $clr;
}

@mixin maxWidth 
{
    max-width: 1450px;
    margin: 0 auto;
}

@mixin maxWidthTwo 
{
    max-width: 1200px;
    margin: 0 auto;
}


@mixin maxWidthThree
{
    max-width: 950px;
    margin: 0 auto;
}


// typography mixins 

@mixin logo-home 
{
    font-size: 18px;
    color: #fff;
    line-height: 20px;
    font-weight: lighter;
}

@mixin nav-links 
{
    font-size: 45px;
    line-height: 67.5px;
    font-weight: bold;
    color: #fff;
}

@mixin contact-info 
{
    font-size: 18px;
    color: #fff;
    line-height: 27px;
    font-weight: lighter;
}

// Home Page start

@mixin showcase-heading 
{
    font-size: 45px;
    line-height: 67.5px;
    font-weight: 100;
    color: #fff;
}



@mixin description-heading 
{
    font-size: 45px;
    line-height: 54px;
    color: #373d4b;
    font-weight: 300;
    font-weight: lighter;
}

@mixin description-heading-resp 
{
    font-size: 30px;
    line-height: 44px;
    color: #373d4b;
    font-weight: 300;
    font-weight: lighter;
}

@mixin description-content 
{
    font-size: 25px;
    line-height: 37.5px;
    color: #373d4b;
    font-weight: lighter;
}

@mixin links() 
{
    font-size: 18px;
    line-height: 18px;
    color: #373D4B;
    @include resetLinks(#373D4B);
}

@mixin proj-heading 
{
    font-size: 32px;
    line-height: 38.4px;
    color: #fff;
    font-weight: bold;
}

@mixin proj-heading-sub 
{
    font-size: 32px;
    line-height: 48px;
    color: #fff;
    font-weight: 300;
}

@mixin service-heading 
{
    font-size: 25px;
    line-height: 37.5px;
    font-weight: 700;
    color: #373D4B;
}

@mixin service-p 
{
    font-size: 16px;
    line-height: 24px;
    font-weight: 400;
    color: #373D4B;
}

@mixin footer-heading 
{
    font-size: 18px;
    line-height: 27px;
    font-weight: 700;
    color: #fff;
}


// Contact

@mixin contact-links 
{
    font-size: 25px;
    line-height: 37.5px;
    color: $primaryClr;
    font-weight: 300;
}

