*,
*:before,
*:after {
    padding: 0;
    margin: 0;
    box-sizing: border-box;
    -webkit-user-drag: none;
    -webkit-user-drag: none;
    -khtml-user-drag: none;
    -moz-user-drag: none;
    -o-user-drag: none;
    background-attachment: none;
    transition: all 0.5s ease-in-out;
    scroll-behavior: smooth;
}


html,
body {
    overflow-x: hidden;
}

img {
    pointer-events: none;
}

